import React from 'react';
import CalculateForm from "./calculateForm";
import {connect} from "react-redux";
import {updateTextComment, updateTextQuantity, updateTextType} from "../../../../redux/calculateFormReducer";

class CalculateFormContainer extends React.Component{
    render() {
        return <CalculateForm/>
    }
}
let mapStateToProps=(state)=>{
    return {
        calculateForm:state.CalculateFormPage
    }
}
const CalculateFormContainerExport = connect(mapStateToProps,{updateTextType,updateTextQuantity,updateTextComment,})(CalculateFormContainer);
export default CalculateFormContainerExport;
